import React, { useState, useEffect } from 'react';

const Destinations = () => {
    const [packaged, setPackages] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:3020/api/destinations`)
            .then(respose => respose.json())
            .then(data => {
                setPackages(data.map(name => (
                    <div className="bg-header body">
                        <div key={name.id} className="col-sm-12 col-md-4 col-lg-4 temp white-box">
                            <div><p>name: {name.name}</p></div>
                            <div><p>location: {name.location}</p></div>
                            <div><p>price: {name.price}</p></div>
                            <div><p>persons: {name.persons}</p></div>
                            <div><p>days: {name.days}</p></div>
                            <div><p>type: {name.type}</p></div>
                        </div>
                    </div>
                )));
            });
    }, []);
    return (
        <div className="bg-header">
            <div className="container body">
                <div className="row">
                    <div className="col-lg-12">
                        <h1 className="intro">Destinations</h1>
                        <div>{packaged}</div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Destinations;
